Kung Fu Beauty 2 - Vivid. AJ is back...legs spread and fists flying! Now she's a bar owner sucked back into the Ninja game, when an Asian girl asks her to help her protect her family. Through a series of encounters with evil mob bosses, she is able to penetrate the Ninja syndicate and keep her promise to her new Asian girlfriend. If you like your sex far out and Far East, Kung Fu Beauty 2 is all yours. And you won't even be hungry for more an hour later...
